import './Home.css';

function Home() {
  return (
    <div className="Home">
      <header className='Home-header'>
        BATTLESHIP
      </header>
      <button class="button button1">Play</button>
      <button>Log In</button>
      <button>Sign Up</button>
    </div>
  );
}

export default Home;
